import style from "./Input.module.css";

const Input = ({setPage}) => {

  return (
    <div className={style.input}>
      <div className={style.inputTitle}>Input</div>
      <div className={style.inputTxt}>
        <div><input type="text" placeholder="input id"/></div>
        <div><input type="text" placeholder="input name"/></div>
        <div><input type="text" placeholder="input price"/></div>
      </div>
      <div className={style.buttons}>
        <button>추가</button>
        <button onClick={()=>{setPage("/")}}>취소</button>
      </div>
    </div>
  );
};

export default Input;
